import React from 'react';
import './App.css';
import AbwabHeader from './AbwabHeader.js';
import TuiCalendar from './TuiCalendar.js';
import TuiImageEditor from './TuiImageEditor.js';
import TuiEditor from './TuiEditor.js';
import AdditionalOptions from './AdditionalOptions.js';

function App() {
  return (
    <div className="App">
      <div className="container">
        <AbwabHeader />
        <TuiEditor />
        <TuiCalendar />
        <TuiImageEditor />
        <AdditionalOptions />
      </div>
    </div>
  );
}

export default App;
